import React, { useEffect } from "react";
import style from '../../assets/css/App.styles'
import { Select, InputLabel, FormControl } from "@material-ui/core";
import { Catalogo } from "../../zustand/types";

export default React.memo(function CustomSelect({
  contenido,catalogo
}: Catalogo){

  const classes = style();



  return (
    <div >
      <FormControl variant="outlined" className={classes.formControl} style={{ padding: "5px" }}>
        <InputLabel htmlFor="outlined-age-native-simple">{catalogo}</InputLabel>
        <Select style={{
          borderRadius: "30px",
          width: "400px",
          borderColor: "blue",
        }}
          native
          label="data"
          inputProps={{
            name: 'data',
            id: 'outlined-age-native-simple',
          }}
        >
          <option aria-label="None" value="" />

        </Select>
      </FormControl>

    </div>
  );


});
